        <section className="collum">
        <a className="link__decoration link__track hover__track link__one" href="#">
          <div className="container ${value}">
            <img className="img__tarck ${value}" src="${img}" alt="" />
            <div className="content__track ${value}">
              <playlist className="name__track ${value}">${'{'}text{'}'}</playlist>
            </div> 
          </div> 
        </a>
      </section>
    );
}

export default Dropdown;
